.passenger {
  background: #f0f3ff;
  width: 100%;
  height: calc(100vh - 80px);
  overflow: hidden;
  padding: 15px;
  position: relative;
}
/* 地图 */
.map2 {
  width: 65%;
  height: 100%;
  border-radius: 0rem;
  float: left;
  margin-right: 15px;
}
/* 人数 */
.pos {
  position: absolute;
  width: 15%;
  bottom: 4vh;
  z-index: 10;
  left: 2vw;
}
.turnover {
  width: 100%;
  height: 10vh;
  background: rgba(47, 49, 83, 1);
  opacity: 0.55;
  overflow: hidden;
  border-radius: 12px;
  color: #fff;
  font-size: 2vh;
  font-family: PingFang SC;
  font-weight: bold;
  color: rgba(255, 255, 255, 1);
  margin-top: 5px;
}
.turnover_img {
  float: left;
  width: 30%;
  height: 100%;
}
.turnover_img > img {
  position: relative;
  left: 50%;
  top: 50%;
  margin-top: -2.5vh;
  margin-left: -2.5vh;
  width: 5vh;
  height: 5vh;
}
.turnover_text {
  height: 100%;
  line-height: 4.5vh;
}
.turnover_text span {
  font-size: 3vh;
  color: #a0b5ff;
  margin-right: 3%;
}
/* 热力图 */
.mifen {
  float: left;
  width: calc(35% - 15px);
  height: 30%;
  border-radius: 0rem;
}
.zhanbi {
  float: left;
  width: calc(35% - 15px);
  height: 30%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0rem 0rem 1rem 0rem rgba(63, 106, 255, 0.08);
  border-radius: 0rem;
  margin-top: 15px;
}
.echtab {
  text-align: center;
  float: left;
  width: calc(35% - 15px);
  height: calc(40% - 30px);
  background: rgba(255, 255, 255, 1);
  box-shadow: 0rem 0rem 1rem 0rem rgba(63, 106, 255, 0.08);
  margin-top: 15px;
  border-radius: 0rem;
}
.footfall {
  width: 100%;
  height: 23vh;
}
.el-tabs__content {
  width: 100%;
  height: 100%;
}
/deep/ .amap-marker-label {
  background: #2f3153;
  color: #fff;
  width: 10vw;
  height: 8vh;
  font-size: 2vh;
  line-height: 3vh;
  text-align: center;
  margin-top: -5vh;
  margin-left: -1.5vw;
}
/deep/ .amap-icon img {
  -webkit-animation: gogogo 2s infinite linear;
}
@-webkit-keyframes gogogo {
  0% {
    transform: scale(0.1);
    opacity: 1;
  }
  100% {
    transform: scale(0.8);
    opacity: 0;
  }
}
